import React from 'react';
import ReactDOM from 'react-dom';   

function Clock(props){
    return (
        <div>
            <h3>Time: {props.toLocaleTimeString()}</h3>
        </div>

    )
}

function tick(){
    ReactDOM.render(<Clock date='new Date()' />, document.getElementById('root'));
}

setInterval(tick, 1000);
